import './App.css';
import Chatroom from './pages/chatroom/Chatroom';
import ChatList from './pages/chatList/ChatList';
import Details from './pages/details/Details';


const App = () => {
  return (
    <>
      <div id='App'>
        <ChatList />
        <Chatroom />
        <Details />
      </div>
    </>
  );
}

export default App;
